import React from "react";
import {useForm} from "react-hook-form";

import Course from '../../image/CourseDataset.png';
import Room from '../../image/RoomDataset.png';
import GenerateButton from "./GenerateBtn";
import UploadButton from "./UploadBtn";
import './UploadPage.css'

const UploadPage = () => {
    const { register, handleSubmit } = useForm();
    const onSubmit = (data) => {
        console.log(data)
    };
    const UploadFile =() =>{
        document.getElementById('fileUpload').click;
    }
    return (
        <React.Fragment>
            <div className="upload-page">
                <div className="upload-page__content">
                    <img src={Course} alt="CourseDataset"></img>
                    <img src={Room} alt="RoomDataset"></img>
                </div>
                <div className="upload-page__textbox"></div>
                <div className="upload-page__button">
                    <form onSubmit={handleSubmit(onSubmit)}>
                        <input id="fileUpload" type="file" style={{displaye:"none"}} {...register('cvs')} />
                            <UploadButton onClick={UploadFile} ></UploadButton>
                    </form>
                    <GenerateButton></GenerateButton>  
                </div>
            </div>
        </React.Fragment>
        
    );
};

export default UploadPage;
